import React, { useEffect, useState } from 'react'
import VideoTile from './VideoTile'
import { API_KEY } from "./data";
import mb from '../assets/mb.jpg'
const HomeVideos = ({Category}) => {
  const [data, setData]= useState([])
  const fetchdata = async () =>{
    const videoList_url = `https://youtube.googleapis.com/youtube/v3/videos?part=snippet%2CcontentDetails%2Cstatistics&chart=mostPopular&regionCode=US&key=${ API_KEY } HTTP/1.1`
    await fetch(videoList_url).then (response => response.json()).then(data=>setData(data.items))
  }
  useEffect(()=>{
    fetchdata();
  },[Category])

  return (
    <link to={`video/20/4521`} className='grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 lg:grid-cols-4 gap-4 '>
      <VideoTile thumbnail={mb} channelImg={mb} description="SGUFGDUIGHDFUIH" channelName="MrBeast" views="12" lastTime="12 months ago" videoLength="12:33" />
      <VideoTile thumbnail={mb} channelImg={mb} description="SGUFGDUIGHDFUIH" channelName="MrBeast" views="12" lastTime="12 months ago" videoLength="12:33" />
      <VideoTile thumbnail={mb} channelImg={mb} description="SGUFGDUIGHDFUIH" channelName="MrBeast" views="12" lastTime="12 months ago" videoLength="12:33" />
      <VideoTile thumbnail={mb} channelImg={mb} description="SGUFGDUIGHDFUIH" channelName="MrBeast" views="12" lastTime="12 months ago" videoLength="12:33" />
      <VideoTile thumbnail={mb} channelImg={mb} description="SGUFGDUIGHDFUIH" channelName="MrBeast" views="12" lastTime="12 months ago" videoLength="12:33" />
      <VideoTile thumbnail={mb} channelImg={mb} description="SGUFGDUIGHDFUIH" channelName="MrBeast" views="12" lastTime="12 months ago" videoLength="12:33" />
      <VideoTile thumbnail={mb} channelImg={mb} description="SGUFGDUIGHDFUIH" channelName="MrBeast" views="12" lastTime="12 months ago" videoLength="12:33" />
      <VideoTile thumbnail={mb} channelImg={mb} description="SGUFGDUIGHDFUIH" channelName="MrBeast" views="12" lastTime="12 months ago" videoLength="12:33" />
      <VideoTile thumbnail={mb} channelImg={mb} description="SGUFGDUIGHDFUIH" channelName="MrBeast" views="12" lastTime="12 months ago" videoLength="12:33" />
      <VideoTile thumbnail={mb} channelImg={mb} description="SGUFGDUIGHDFUIH" channelName="MrBeast" views="12" lastTime="12 months ago" videoLength="12:33" />
      <VideoTile thumbnail={mb} channelImg={mb} description="SGUFGDUIGHDFUIH" channelName="MrBeast" views="12" lastTime="12 months ago" videoLength="12:33" />
      <VideoTile thumbnail={mb} channelImg={mb} description="SGUFGDUIGHDFUIH" channelName="MrBeast" views="12" lastTime="12 months ago" videoLength="12:33" />
        








    </link>
  )
}

export default HomeVideos
